BEGIN TRANSACTION;
DROP TABLE IF EXISTS "VOTERS";
CREATE TABLE VOTERS(
                [ID] INTEGER PRIMARY KEY,
                [FULLNAME] TEXT,
                [PRECINT] TEXT,
                [PUROK],
                [BARANGAY] TEXT,
                [CLUSTER] TEXT,
                [MUNICIPALITY] TEXT);
DROP VIEW IF EXISTS "CAPTURED";
CREATE VIEW "CAPTURED" AS SELECT BARANGAY,COUNT(ID) AS FIGURE FROM PROFILE WHERE TYPE='Y' GROUP BY BARANGAY;
DROP VIEW IF EXISTS "TARGET";
CREATE VIEW "TARGET" AS SELECT Barangay,count(id) as votersfigure,round(count(id)*.67,0)as target from voters group by barangay;
DROP VIEW IF EXISTS "figure_barangay";
CREATE VIEW figure_barangay as Select barangay,count(id) as figure from voters group by barangay;
COMMIT;
